import re
import matplotlib.pyplot as plt

# copy the log generated by the receiver here
log_data = """


"""

udp_rates = [float(match.group(1)) for match in re.finditer(r"UDP:\s+([\d.]+)", log_data)]
tcp_rates = [float(match.group(1)) for match in re.finditer(r"TCP:\s+([\d.]+)", log_data)]
plt.figure(figsize=(10, 4))
plt.plot(udp_rates, marker='o')
plt.plot(tcp_rates, marker='o')
plt.title("UDP/TCP Throughput Over Time")
plt.xlabel("Time (seconds)")
plt.ylabel("Throughput (kbit/s)")
plt.grid(True)
plt.tight_layout()
# plt.show()
plt.savefig("udp_throughput.png")